import React  from "react";

const What=(state)=>{
     const {items} = state;
  const add = items.map=(item=>{
    return(
      <div id="item.id">
<p>{item.name}</p>

<p>{item.age}</p>
        </div>
    )      

}
  )       
  return(
   <div>  
      {add(items)}
   </div>
  )  
}
export default What;
